import React, { useEffect, useState } from "react";

function View() {

    const [user,setUser] = useState([]);

    useEffect(() => {
        const fetchUser = async(id) => {
            try{
                const res = await axios.get(`http://localhost:3000/users/${id}`)
                setUser(res.data)
            } catch(err) {
                console.log(err)
            }
        }
        fetchUser();
    })

    return (
        <div>
            <h1>View User</h1>
        </div>
    )
}

export default View;
